export const SignUpContainer = styled.div`
  display: flex;
  flex-direction: column;
  width: 380px;

  h4 {
    margin: 10px 0;
  }
`;
export const ButtonsContainer = styled.div`
  display: flex;
  justify-content: space-between;
`;
